INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(1, 181, 'Die Azzam ist mit einer Länge von 180 Meter die längste private Mega-Yacht der Welt. Eigentümer ist Scheich Chalifa bin Zayid Al Nahyan, Präsident der Vereinigten Arabischen Emirate.', , 1, 'Azzam');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(2, 163, 'Die Eclipse ist mit einer Länge von 163 Meter die aktuell zweitlängste Mega-Yacht der Welt. Sie wurde im Herbst 2010 von der Hamburger Werft Blohm + Voss an den Eigner des Schiffes, den russischen Milliardär Roman Abramowitsch übergeben. Der Gesamtpreis wurde auf 340 Millionen Euro geschätzt. Inklusive Extras wie dem U-Boot und dem Raketenabwehrsystem soll sie sogar bis zu 850 Millionen Euro kosten.', , 1, 'Eclipse');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(3, 162, 'Die Dubai ist eine Mega-Yacht, die sich im Besitz des Scheichs Muhammad bin Raschid Al Maktum, des Herrschers des Emirates Dubai, befindet. Die 162 Meter lange Yacht steht auf Platz 3 der Liste der längsten Motoryachten. Die Dubai wurde 1995 unter verschiedenen Projektnamen („Panhandle“, „Golden Star“) in Auftrag gegeben und ursprünglich in Zusammenarbeit der deutschen Werften Blohm + Voss und Lürssen gebaut. Im Jahr 1997 wurde der Bauauftrag jedoch vom Auftraggeber gestoppt und ging 2001 an den neuen Eigner, Muhammad bin Raschid Al Maktum, den Herrscher des Emirates Dubai. Das Schiff mitsamt Schwimmdock wurde mit der Blue Marlin über die Türkei nach Dubai transportiert. Die in Dubai ansässige Platinum Yachts FZCO Werft baute das Schiff unter dem Projektnamen Platinum weiter und übergab diese an den Eigner 2006. Die Yacht hat einen Liegeplatz vor der nördlichen der beiden künstlichen Logo Islands, der Privatinsel Al Maktums.', , 0, 'Dubai');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(4, 155, 'Die Al Said ist mit einer Länge von 155 Metern die derzeit viertlängste private Mega-Yacht der Welt. Der Entwurf stammt von Espen Oeino Naval Architects. Der Stapellauf des unter dem Projektnamen „Sunflower“ auf der deutschen Werft Lürssen gebauten Schiffes erfolgte 2007 und die Übergabe 2008. Eigner ist seitdem das Sultanat Oman in Person von Qabus ibn Said, dem das Schiff als königliche Yacht zur Verfügung steht. Die Yacht wird von zwei jeweils 8.200 kW leistenden MTU-Dieselmotoren angetrieben, die das Schiff auf maximal 14,5 Knoten beschleunigen können. Der Rumpf besteht aus Stahl, die Aufbauten aus Aluminium. Details über die Inneneinrichtung werden offiziell nicht bekannt gegeben. Neben einem Hubschrauberlandeplatz, soll die Yacht aber über einen Konzertsaal für ein 50-köpfiges Orchester, ein Kino und eine Sauna-Landschaft verfügen.Die über 8000 m² Fläche der Mega-Yacht verteilen sich auf sechs Decks. An Bord ist Platz für eine 150-köpfige Besatzung, die sich um die bis zu 65 Gäste kümmert.', , 1, 'Al Said');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(5, 147, 'Die 147 Meter lange Topaz ist ein weiteres Lürssen-Schiff. Sie wurde 2012 ausgeliefert. Die Topaz fährt unter der Flagge der Kaimaninseln. Heimathafen ist George Town.', , 1, 'Topaz');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(6, 139, 'Die Al Salamah ist eine 139 Meter lange Mega-Yacht, die sich im Besitz von Sultan ibn Abd al-Aziz, dem verstorbenen Kronprinzen von Saudi-Arabien befand. Die Al Salamah wurde 1999 als Lürssen-Projekt MiPos (Mission Possible) bei HDW in Kiel gebaut und bei Lürssen in Bremen vollendet. Die Yacht verfügt über einen Hubschrauberlandeplatz, einen Outdoorpool und große Empfangsräume. Die Wohnfläche von 8.000 m² ist auf 80 Kabinen aufgeteilt. Der Außenbereich ist 3.300 m² groß und mit Teakholz ausgelegt. Für das Wohl der Bewohner und der Yacht sind 96 Crewmitglieder zuständig.', , 0, 'Al Salamah');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(7, 134, 'Die Serene ist eine 134 Meter lange Mega-Yacht. Die Kiellegung fand im März 2007 bei Fincantieri auf der Werft in Muggiano, der Stapellauf am 18. September 2010 statt. Die Bauwerft gibt an, dass es sich bei der Serene um die größte in Italien gebaute Yacht handelt. Für das Außendesign war das monegassische Unternehmen Espen Øino International verantwortlich, das Innendesign stammt vom Londoner Unternehmen Reymond Langton Design. Neben den sieben Decks mit einer Gesamtfläche von 4.500 m² befinden sich an Bord zwei Hubschrauberlandeplätze, ein Hangar für einen Hubschrauber, ein Salzwasserpool und ein U-Boot für eine Tauchtiefe von bis zu 100 Metern.', , 1, 'Serene');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(8, 126, 'Die Octopus hat eine Länge von 126 m und wurde im Jahr 2003 an ihren Besitzer Paul Allen ausgeliefert. Die Yacht beherbergt zwei Hubschrauber in einem dazugehörigen Hangar, ein 19 m langes Beiboot sowie ein U-Boot für acht Personen. Seitenluken oberhalb der Wasserlinie dienen als Garage für kleinere Beiboote und Jetskis. Sie wurde von Espen Øino Naval Architects entworfen und bei HDW in Kiel im Auftrag von Lürssen gebaut. Der Rumpf ist aus Stahl. Paul Allen nutzte die Yacht und die Ausrüstung zur Tiefseeerforschung im Jahr 2015, um nach dem Wrack des japanischen Superschlachtschiffes Musashi zu suchen, das im Zweiten Weltkrieg in der Sibuyan-See versenkt worden war. Anfang März 2015 entdeckte Allen das Wrack in etwa 1.000 Metern Tiefe.', , 1, 'Octopus');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(9, 119, 'Die A ist eine der größten privaten Mega-Yachten der Welt. In der Liste der längsten Motoryachten belegt sie Platz 16. Ihr Besitzer ist der russische Milliardär Andrei Igorewitsch Melnitschenko.', , 1, 'Yacht A');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(10, 156, 'Die Dilbar wurde 2015 bis 2016 auf der Lürssen Werft in Bremen, Deutschland gebaut und ist derzeit eine der größten Mega-Yachten der Welt. Das Schiff wurde unter Geheimhaltung und der Bezeichnung Project Omar gebaut. Der Eigner Alischer Usmanow ersetzte mit dem Neubau die namensgleiche, aber deutlich kleinere Dilbar (nun Ona).', , 1, 'Dilbar');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(11, 147, 'Die Abdul Aziz ist eine der Mega-Yachten im Besitz der saudi-arabischen Königsfamilie. Sie war mit einer Länge von 147 Metern bei Auslieferung die längste und größte Motoryacht der Welt und behielt diesen Status für 22 Jahre, so dass sie heute als größte Luxusyacht des 20. Jahrhunderts gilt. Gebaut wurde sie 1984 als Maierform von der Helsingør Værft in Dänemark. Der erste Besitzer war der König von Saudi-Arabien Fahd ibn Abd al-Aziz. Nach dessen Tod 2005 wird sein Halbbruder Abdullah ibn Abd al-Aziz als Besitzer angegeben, der das Schiff über die Sulamith Management Inc. betreibt. Das 147 Meter lange Schiff hat eine Breite von 18,3 Metern und einen Tiefgang von 4,9 Metern. Es besitzt zwei 5816 kW Pielstick-Dieselaggregate für den Antrieb. Die Reisegeschwindigkeit beträgt 18 Knoten, die Maximalgeschwindigkeit 22 Knoten. Die Yacht benötigt im Vollbetrieb eine 60- bis 65-köpfige Besatzung. Innenausstatter war David Nightingale Hicks.', , 1, 'Prince Abdulaziz');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(12, 141, 'Die Yas ist eine private Superyacht von ADM Shipyards (Abu Dhabi) erbaut und im Jahr 2011 ins Leben gerufen. Besitzer des Schiffes ist Hamdan bin Zayed Al Nahyan. Mit einer Länge von 141 Metern zählt sie zu den größten Motoryachten der Welt.', , 0, 'Yas');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(13, 133, 'Die Al Mirqab wurde 2004 in Auftrag gegeben. Entworfen wurde sie von Kusch Yachts, die Außenanlagen gestaltete Tim Heywood. Zu Beginn trug sie den Projektnamen Project May. Gebaut wurde die Yacht bei Peters Schiffbau im schleswig-holsteinischen Wewelsfleth. Der Bau dauerte vier Jahre und wurde von 700 Spezialisten aus ganz Europa durchgeführt. Nach ihrer Fertigstellung 2008 erfolgten die Testfahrten der Yacht in der Bucht vor Eckernförde bei Kiel. Bis die Panama Papers im Jahre 2016 die Hintergründe enthüllten, galt der ehemalige Emir von Katar, Hamad bin Chalifa Al Thani, als Eigentümer. Aus den Panama Papers geht hervor, dass die Yacht für eine Briefkastenfirma namens Trick One Limited gebaut wurde, hinter der offenbar Hamad ibn Dschasim ibn Dschabir Al Thani steht. Die Inneneinrichtung wurde von Andrew Winch Designs entworfen. Die Yacht verfügt über einen Hubschrauberlandeplatz inklusive einer EC 155, einen Miniatur-Pool auf Deck, eine Bibliothek, ein Wellnessbereich, einen Gäste-Speisetisch, ein Herrenzimmer und ein Kino.', , 1, 'Al Mirqab');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(14, 138, 'Die Rising Sun ist eine auf der Lürssen-Werft gebaute Mega-Yacht mit einer Länge von 138 Metern. Der Kaufpreis wird auf über 200 Mio. US-Dollar geschätzt. Die Yacht gehörte bei ihrer Auslieferung im Jahre 2004 Larry Ellison, damals CEO der Oracle Corporation, der 2007 eine Hälfte an David Geffen abgab. 2010 übernahm Geffen die verbliebenen Anteile von Ellison, nachdem dieser sich eine neue Yacht hatte bauen lassen. Das Schiff verfügt über vier MTU-Dieselmotoren des Typs 20V8000 M90 mit einer Leistung von insgesamt 36.000 kW, die auf vier Propeller wirken. Es erreicht damit eine Geschwindigkeit von mehr als 28 Knoten. An Bord befinden sich auf fünf Decks 82 Räume mit einer Gesamtgröße von über 8000 m², darunter Badezimmer mit Whirlpool sowie Fitness-, Erholungs- und Saunaräume, ein umfangreicher Weinkeller sowie ein Kino mit Plasmabildschirmen. Das Teak-Deck des Schiffes ist mehr als 3300 m² groß. Auf dem Hauptdeck befindet sich achtern ein Basketballplatz, der auch als Hubschrauberlandeplatz genutzt werden kann.', , 1, 'Rising Sun');
INSERT INTO `product` (`id`, `price`, `description`, `image`, `instock`, `title`) VALUES
(15, 140, 'Mit der Ocean Victory lieferte die italienische Werft Fincantieri nach der Serene ihre zweite Superyacht aus. 2014 wurde der Sieben-Decker, bis dato die größte auf einer italienischen Werft gebaute Yacht, an den russischen Unternehmer Wiktor Filippowitsch Raschnikow übergeben. Die von Espen Øino gezeichnete und durch Alberto Pinto eingerichtete Yacht verfügt über 13 Kabinen für 26 Gäste und wird von einer 50-köpfigen Crew betreut. Insgesamt sechs Pools verteilen sich an Bord, dazu ein Beach-Club, Fitnessräume, ein Kino und sogar eine Unterwasser-Beobachtungslounge. Der Bord-Bordhubschrauber parkt in einem Hangar unter Deck, für einen 14m-Tender wurde ein komplett flutbares Dock errichtet. Der Kaufpreis wird auf 300 Millionen Euro geschätzt.', , 1, 'Ocean Victory');
