DROP SCHEMA IF EXISTS `myshop`;
CREATE SCHEMA `myshop`;
USE `myshop`;

CREATE TABLE `user` (
  `id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  `name` VARCHAR(20) NOT NULL UNIQUE,
  `email` VARCHAR(100) NOT NULL UNIQUE,  
  `password_hash` VARCHAR(100) NOT NULL
) DEFAULT CHARSET=utf8;


CREATE TABLE `product` (
  `id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  `price` INT NOT NULL,
  `description` LONGTEXT DEFAULT NULL,
  `image` LONGBLOB DEFAULT NULL,
  `instock` TINYINT(1) DEFAULT 0,
  `title` VARCHAR(50) NOT NULL UNIQUE
) DEFAULT CHARSET=utf8;


CREATE TABLE `booking` (
  `id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  `date` DATE DEFAULT NOW(),
  `bookingprice` INT NOT NULL,
  `user_id` INT NOT NULL,
  `product_id` INT NOT NULL,
  CONSTRAINT `fk_booking_user_id` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`),
  CONSTRAINT `fk_booking_product_id` FOREIGN KEY (`product_id`) REFERENCES `product` (`id`)
) DEFAULT CHARSET=utf8;
